function ChipDrive() {
	this.connection;
	this.folderIds = [];
	this.folderNames = [];
	this.frame;
	this.innerFrame;
	this.apiVersion = 0;
	this.write = false;
	this.token = 0;
	this.login;
	this.isLoggingIn = false;
	this.folderid = "";
	this.methods = {
		
	};
	this.errors = {
		AUTH_ERROR: 0,
		RESPONSE_ERROR: 1,
		SERVER_ERROR: 2,
		JSON_ERROR: 3,
	};
	var that = this;
	this.init = function(config, callback, login) {
		if(window.coldchip == true) {
			var configURL    = config.config;
			var apiVersion   = config.API_VERSION;
			var token        = config.credentials.token;
			var frame        = config.event.frame;
			var addonNewBtn  = config.event.newBtn;
			var quotaBar     = config.event.quotaBar;
			var quotaStatus  = config.event.quotaStatus;

			that.apiVersion  = apiVersion;
			that.token       = 0;
			that.quotaBar    = quotaBar;
			that.quotaStatus = quotaStatus;

			that.login       = login;

			var innerFrame = document.createElement("div");
			innerFrame.className = "innerFrame";
			
			config.event.frame.appendChild(innerFrame);
			that.innerFrame = innerFrame;

			innerFrame.addEventListener("contextmenu", function(e) {
				e.preventDefault();
				that.newItem();
			});

			that.frame = config.event.frame;

			if(addonNewBtn) {
				addonNewBtn.addEventListener("click", function() {
					that.newItem();
				});
			}

			var newButton = document.createElement("button");
			newButton.className = "newBtn text";
			newButton.innerHTML = "New";
			that.frame.appendChild(newButton);
			newButton.addEventListener("click", function() {
				that.newItem();
			});
			that.newButton = newButton;

			send("GET", configURL, "", function(data) {
				var dataJSON = JSON.parse(data);
				that.connection = new that.Connect(dataJSON.gateway);
				that.methods = dataJSON.methods;
				callback(that);
			}, function(error) {
				new popup().bindAlert("Unable to retrieve config", () => {
					that.init(config, callback, login);
				});
			});
		} else {
			alert("Error: Dependency coldchip.js not loaded. ");
			throw new Error("Error: Dependency coldchip.js not loaded. ");
		}
	}
	this.showNewBtn = function(addonNewBtn) {
		this.newButton.style.display = "block";
	}
	this.hideNewBtn = function() {
		this.newButton.style.display = "none";
	}
	this.setMode = function(mode) {

	}
	this.getQuota = function(callback) {
		that.connection.send(JSON.stringify({"mode":that.methods.driveQuota}), "", true, function(data) {
			var u = parseFloat(((data.used / data.available) * 100).toFixed(3));
			callback(Object({used: u, total: 100, usedFormat: that.formatBytes(data.used), totalFormat: that.formatBytes(data.available)}));
		}, function() {

		});
	}
	this.getFiles = function(path) {
		if(path == undefined) {
			path = "";
		}
		$("controls").innerHTML = "";
		var btn = $$("button");
		btn.className = "controlsButton";
		btn.onclick = function() {
			that.folderIds = [];
			that.folderNames = [];
			that.getFiles();
		}
		var p = $$("span");
		p.className = "controlsLabel text";
		p.innerHTML = "My Drive";
		var i = $$("i");
		i.className = "fa fa-chevron-right";
		i.style.margin = "0px 0px 0px 10px";
		btn.appendChild(p);
		btn.appendChild(i);
		$("controls").appendChild(btn);
	    var loader = new Loader(that.innerFrame);
		loader.show();
		
		var folderid = path ? path : that.getLast();
	    that.connection.send(JSON.stringify({"mode": that.methods.list, "folderid": folderid}), "", true, function(items) {
			if(path) {
				that.folderNames.push(items.displayName);
				that.folderIds.push(path);
			}
			window.location.hash = that.getLast();
			for(var i in that.folderIds) {
				var btn = $$("button");
				btn.className = "controlsButton";
				btn.id = i;
				btn.onclick = function() {
					var pointsTo = that.folderIds[this.id];
					that.folderIds = that.folderIds.slice(0, parseInt(this.id) );
					that.folderNames = that.folderNames.slice(0, parseInt(this.id) );
					that.getFiles(pointsTo);
				};
				var p = $$("span");
				p.className = "controlsLabel text";
				p.innerHTML = that.folderNames[i];
				var i = $$("i");
				i.className = "fa fa-chevron-right";
				i.style.margin = "0px 0px 0px 10px";
				btn.appendChild(p);
				btn.appendChild(i);
				$("controls").appendChild(btn);
				$("controls").scrollLeft = "999999999";
			}
			loader.hide();
			var list = items.list;
	        that.innerFrame.innerHTML = "";
	        if (list.length > 0) {
				var driveContents = that.innerFrame;
	            for (var b in list) {
					var type = list[b]["kind"];
					var itemName = list[b]["displayName"];
					var itemId = list[b]["id"];
					driveContents.appendChild(makeHTML(itemId, itemName, type, theme, b));	
	            }
	        } else {
				var emptyMsg = document.createElement("p");
					emptyMsg.className = "text";
					emptyMsg.style.fontSize = "1.6em";
					emptyMsg.style.marginTop = "20px";
					emptyMsg.style.marginBottom = "50px";
					emptyMsg.style.fontWeigt = "450";
					emptyMsg.innerHTML = "This folder is empty. ";
				that.innerFrame.appendChild(emptyMsg);
				var empty = document.createElement("img");
					empty.src = theme.emptyFolder;
					empty.style.width = "197px";
					empty.style.height = "250px";
				that.innerFrame.appendChild(empty);
	        }
	    }, function(error, callback) {
	    	that.folderIds.pop();
			loader.hide();
			new popup().bindAlert(error, callback);
		});
		var makeHTML = function (itemId, itemName, type, img, i) {
			var itemWrapper = document.createElement("div");
			var itemWrapperWidth = 180;
			var itemWrapperHeightRatio = 1.2;
			var editedWidth = 0;
			if(Math.floor(that.innerFrame.offsetWidth / itemWrapperWidth) < 3) {
				editedWidth = Math.floor(that.innerFrame.offsetWidth / 3);
			} else {
				editedWidth = Math.floor(itemWrapperWidth);
			}
			var itemsPerRow = Math.floor(that.innerFrame.offsetWidth / (editedWidth + 2 + 14));
			itemWrapper.style.width = ((that.innerFrame.offsetWidth / (itemsPerRow)) - 2 - 15) + "px";
			itemWrapper.style.height = editedWidth * itemWrapperHeightRatio + "px";
			itemWrapper.className = "itemWrapper";
			itemWrapper.id = "itemWrapper";
			itemWrapper.style.margin = "7px 7px";
			window.onresize = function() {
				var ancestor = that.innerFrame,
	    		descendents = ancestor.getElementsByTagName('*');
	    		for (var i = 0; i < descendents.length; ++i) {
	    			if(descendents[i].id == "itemWrapper") {
	    				var editedWidth = 0;
	    				if(Math.floor(that.innerFrame.offsetWidth / itemWrapperWidth) < 3) {
							editedWidth = Math.floor(that.innerFrame.offsetWidth / 3);
						} else {
							editedWidth = Math.floor(itemWrapperWidth);
						}
		    			var itemsPerRow = Math.floor(that.innerFrame.offsetWidth / (editedWidth + 2 + 14));
					    descendents[i].style.margin = "7px 7px";
						descendents[i].style.width = ((that.innerFrame.offsetWidth / (itemsPerRow)) - 2 - 15) + "px";
						descendents[i].style.height = editedWidth * itemWrapperHeightRatio + "px";
					}
				}
				resize();
			}
			itemWrapper.onmouseover = function() {
				itemWrapper.style.background = "rgba(80, 80, 80, 0.1)";
			}
			itemWrapper.onmouseout = function() {
				itemWrapper.style.background = "";
			}
			itemWrapper.ontouchstart = function() {
				itemWrapper.style.background = "rgba(80, 80, 80, 0.1)";
			}
			itemWrapper.ontouchend = function() {
				itemWrapper.style.background = "";
			}
			itemWrapper.addEventListener('contextmenu', (ev) => {
				ev.preventDefault();
	            that.fileOptions(itemName, itemId, type);
	        }, false);
			var icon = document.createElement("img");
						icon.className = "itemWrapperIcon";
						if(type == 1){
							var ext = itemName.substr(itemName.lastIndexOf('.') + 1).toLowerCase();
							if(imageExt.indexOf(ext) >= 0) {
								icon.src = (img.imgIconData);
							} else if(videoExt.indexOf(ext) >= 0) {
								icon.src = (img.vidIconData);
							} else if(audioExt.indexOf(ext) >= 0) {
								icon.src = (img.musIconData);
							} else if(archiveExt.indexOf(ext) >= 0) {
								icon.src = (img.arIconData);
							} else if(ext == "html" || ext == "htm" || ext == "js") {
								icon.src = (img.htmlIconData);
							} else if(ext == "php") {
								icon.src = (img.phpIconData);
							} else if(ext == "pdf") {
								icon.src = (img.pdfIconData);
							} else if(ext == "pptx" || ext == "ppt" || ext == "pptm") {
								icon.src = (img.pptIconData);
							} else if(ext == "docx" || ext == "docm" || ext == "doc") {
								icon.src = (img.wordIconData);
							} else if(ext == "psd") {
								icon.src = (img.psdIconData);
							} else if(ext == "xlsx" || ext == "xls") {
								icon.src = (img.xlsxIconData);
							} else if(ext == "css") {
								icon.src = (img.cssIconData);
							} else if(ext == "txt") {
								icon.src = (img.txtIconData);
							} else {
								icon.src = (img.fileIconImageData);
							}
							
						} else { 
							icon.src = (img.folIconImageData);
						}
						icon.onclick = function() {
							type == 1 ? that.openFile(itemId) : that.getFiles(itemId);
						};
			itemWrapper.appendChild(icon);
			
			var button = document.createElement("p");
						button.className = "text itemWrapperButton";
						button.innerHTML = itemName;
						button.onclick = function() {
							type == 1 ? that.openFile(itemId) : that.getFiles(itemId);
						};
			itemWrapper.appendChild(button);
			
			var options = document.createElement("img");
						options.style.outline = "none";
						options.style.height = "20px";
						options.style.border = "none";
						options.style.position = "absolute";
						options.style.top = "7.5px";
						options.style.right = "7.5px";
						options.style.margin = "0";
						options.src = (img.optionsIconImageData);
						options.onclick = function() { that.fileOptions(itemName, itemId, type); };
			itemWrapper.appendChild(options);
			return itemWrapper;
		}
	}
	this.openFile = function(id) {
		var load = new Loader();
		load.show();
		that.connection.send(JSON.stringify({"mode":that.methods.streamLink, "fileid": id}), "", true, function(data) {
			load.hide();
			var ext = data.ext;
			var pop = new Panel(document.body);
	        if (imageExt.indexOf(ext) >= 0) {
				var img = document.createElement("img");
				img.style.width = "95%";
				img.style.height = "auto";
				img.style.animationName = "fadeIn";
				img.style.animationDuration = "0.3s";
				img.style.backgroundSize = "cover";
				img.style.backgroundPosition = "center";
				img.style.overflow = "hidden";
				img.style.margin = "50px auto";
					img.src = data.url;
	            	img.style.position = "relative";
					pop.show(img);
				
	        } else if (videoExt.indexOf(ext) >= 0) {
				var video = document.createElement("video");
				video.style.height = "95%";
				video.style.animationName = "fadeIn";
				video.style.animationDuration = "0.3s";
				video.setAttribute("controls", true);
				video.style.margin = "auto auto";
	            video.style.position = "relative";
				var source = document.createElement("source");
				source.type = data.type;
					source.src = data.url;
					video.appendChild(source);
					pop.show(video);
	        } else if (audioExt.indexOf(ext) >= 0) {
				var audio = document.createElement("audio");
				audio.setAttribute("controls", true);
				audio.setAttribute("preload", "auto");
				audio.style.margin = "auto auto";
	            audio.style.position = "relative";
	            audio.style.marginTop = "100px";
	            audio.title = data.displayName;
				var source = document.createElement("source");
				source.type = data.type;
					source.src = data.url;
					audio.appendChild(source);
					pop.show(audio);
	        } else if(archiveExt.indexOf(ext) >= 0) {
				new popup().bindAlert("Opening Archive files aren't supported at this time. ", function(){});
	        } else {
				new popup().bindAlert("Unknown File Format. ", function(){});
			}
		}, function(error, callback) {
			load.hide();
			new popup().bindAlert(error, callback);
		});
	}
	this.Upload = function() {
		uploader = this;
		this.uploadElem;
		this.loader;
		this.totalUploadSize = 0;
		this.totalUploadedSize = 0;
		this.start = function() {
			uploader.uploadElem = document.createElement("input");
			uploader.uploadElem.setAttribute("type", "file");
			uploader.uploadElem.setAttribute("multiple", true);
			uploader.uploadElem.style.display = "none";
			uploader.uploadElem.click();
			uploader.uploadElem.onchange = function() {
				uploader.invokeUpload();
			}
		}
		this.invokeUpload = function() {
			if(uploader.uploadElem) {
				uploader.loader = new Loader();
				uploader.loader.show();
				for(var i = 0; i < uploader.uploadElem.files.length; i++) {
					uploader.totalUploadSize += uploader.uploadElem.files[i].size;
				}
				uploader.uploadFactory(0);
			}
		}
		this.uploadFactory = function(i) {
			that.connection.send(JSON.stringify({"mode":that.methods.upload, "folderid": that.getLast(), "name": uploader.uploadElem.files[i].name}), this.uploadElem.files[i], "application/octet-stream", function(res) {
				i++;
				if(i < uploader.uploadElem.files.length) {
					uploader.totalUploadedSize += uploader.uploadElem.files[i - 1].size;
					uploader.uploadFactory(i);
				} else {
					uploader.loader.hide();
					that.getFiles();
				}
			}, function(error, callback) {
				uploader.loader.hide();
				new popup().bindAlert(error, callback);
			}, function(sent, total) {
				var progress = uploader.totalUploadedSize + sent;
				var percentage = (progress / uploader.totalUploadSize) * 100;
				uploader.loader.changeText((percentage).toFixed(2) + " / 100%");
			});
		}
	}
	this.newFolder = function() {
		new popup().bindPrompt("Give it a name. ", "CREATE", function(name){
			if (name) {
				if(name.indexOf("/") == -1) {
					var load = new Loader();
					load.show();
					that.connection.send(JSON.stringify({"mode":that.methods.newFolder, "folderid": that.getLast(), "name":name}), "", true, function(res) {
						load.hide();
						that.getFiles();
					}, function(error, callback) {
						load.hide();
						new popup().bindAlert(error, callback);
					});
				} else {
					new popup().bindAlert("Folder name should not contain \"/\"", function(){});
				}
			}
		});
	}
	this.newItem = function(create) {
		new Contextual({
			isSticky: false,
			items: [
				new ContextualItem({icon: theme.uploadIconData, label:'Upload', onClick: () => {
					var upload = new that.Upload();
					upload.start(true, "file"); 
				}}),
           		new ContextualItem({icon: theme.folderIconData, label:'Folder', onClick: () => { 
            		that.newFolder();
            	}}),
			]
		});
	    
	}
	this.deleteItem = function(itemid) {
		new popup().bindConfirm("Are you sure? ", function(){
			var loader = new Loader();
			loader.show();
			that.connection.send(JSON.stringify({"mode":that.methods.delete, "itemid": itemid}), "", true, function(res) {
				loader.hide();
				that.getFiles();
	        }, function(error, callback) {
				loader.hide();
				new popup().bindAlert(error, callback);
			});
		})
			
	}
	this.fileOptions = function(name, id, type) {
		var fileType = [
			new ContextualItem({icon: theme.previewIconData, label:'Open', onClick: () => {
					that.openFile(id);
				}}),
            new ContextualItem({icon: theme.renameIconData, label:'Rename', onClick: () => { 
            		that.rename(id, name);
            	}}),
            new ContextualItem({icon: theme.copyIconData, label:'Copy', onClick: () => { 
            		alert("not supported");
            	}}),
            new ContextualItem({icon: theme.deleteIconData, label:'Delete', onClick: () => { 
            		that.deleteItem(id);
            	}}),
            new ContextualItem({icon: theme.downloadIconData, label:'Download', onClick: () => { 
            		that.downloadItem(id);
            	}}),
            new ContextualItem({icon: theme.infoIconData, label:'File Info', onClick: () => { 
            		that.fileInfo(id);
            	}})
		];
		var folderType = [
			new ContextualItem({icon: theme.previewIconData, label:'Open', onClick: () => {
					that.getFiles(id);
				}}),
            new ContextualItem({icon: theme.renameIconData, label:'Rename', onClick: () => { 
            		that.rename(id, name);
            	}}),
            new ContextualItem({icon: theme.copyIconData, label:'Copy', onClick: () => { 
            		alert("not supported");
            	}}),
            new ContextualItem({icon: theme.deleteIconData, label:'Delete', onClick: () => { 
            		that.deleteItem(id);
            	}}),
            new ContextualItem({icon: theme.shareIconData, label:'Get Shareable Link', onClick: () => { 
            		that.share(id);
            	}}),
            new ContextualItem({icon: theme.infoIconData, label:'Folder Info', onClick: () => { 
            		that.fileInfo(id);
            	}})
		];
		if(type == 1) {
			new Contextual({
	            isSticky: false,
	            items: fileType
	        });
		} else {
			new Contextual({
	            isSticky: false,
	            items: folderType
	        });
		}
		
	}
	this.share = function(id) {
		alert("Not Implemented");
	}
	this.rename = function(id, displayName) {
		new popup().bindPrompt("Renaming \"" + (displayName) + "\"", "RENAME", function(name){
			if (name) {
				
				that.connection.send(JSON.stringify({"mode":that.methods.rename, "itemid": id, "name": name}), "", true, function(res) {
					that.getFiles();
				}, function(error, callback) {
					new popup().bindAlert(error, callback);
				});
			}
		});
	}
	this.downloadItem = function(id) {
		var loader = new Loader();
		loader.show()
	    that.connection.send(JSON.stringify({"mode":that.methods.streamLink, "fileid": id}), "", true, function(data) {
			loader.hide();
			if (/iPad|iPhone|iPod/.test(navigator.userAgent) && !window.MSStream) {
		    	window.location = data.url;
		    } else {
				var a = document.createElement("a");
					a.style.display = "none";
					a.style.height = "0px";
					a.href = data.url;
					a.download = id;
					document.body.appendChild(a);
					a.click();
		    }
		}, function(error, callback) {
			loader.hide();
			new popup().bindAlert(error, callback);
		});
	}
	this.fileInfo = function(fileid) {
		var loader = new Loader();
		loader.show();
		that.connection.send(JSON.stringify({"mode":that.methods.fileInfo, "fileid":fileid}), "", true, function(res) {
			loader.hide();
			var pop = new Panel(document.body);
			var data = document.createElement("p");
				data.className = "text";
				data.style.marginTop = "50px";
				data.innerHTML = "File Size: " + that.formatBytes(res.size);
			pop.show(data);
	    }, function(error, callback) {
			loader.hide();
			new popup().bindAlert(error, callback);
		});
	}
	this.formatBytes = function(bytes) {
	    if(bytes < 1024) return bytes + " Bytes";
	    else if(bytes < 1048576) return(bytes / 1024).toFixed(2) + " KB";
	    else if(bytes < 1073741824) return(bytes / 1048576).toFixed(2) + " MB";
	    else if(bytes < 1099511627776) return(bytes / 1073741824).toFixed(2) + " GB";
	    else return(bytes / 1099511627776).toFixed(2) + " TB";
	}
	this.getPath = function() {
		var result = "";
		for(var i = 0; i < that.folderIds.length; i++) {
			if(that.folderIds[i].substr(-1) == "/") {
				result += that.folderIds[i];
			} else {
				result += that.folderIds[i] + "/";
			}
		}
		return result;
	}

	this.joinPath = function(path, name) {
		if(path.substr(-1) == "/") {
			return (path + (name)).replace(/^\//, "");
		}
		return (path + "/" + (name)).replace(/^\//, "");
	}
	this.getLast = function() {
		var id =  that.folderIds[that.folderIds.length - 1];
		if(id == undefined) {
			return "";
		}
		return id;
	}
	this.baseName = function(str)
	{
		var base = new String(str).substring(str.lastIndexOf('/') + 1); 
		return base;
	}
	this.toArrayBuffer = function(str) {
		var buf = new ArrayBuffer(str.length);
		var bufView = new Uint8Array(buf);
		for (var i = 0, strLen = str.length; i < strLen; i++) {
			bufView[i] = str.charCodeAt(i);
		}
		return buf;
	}
	this.toBlob = function(dataURI) {
		try {
			var meta = dataURI.split(',')[0].split(";")[0].split(":")[1];
			var byteString = atob(dataURI.split(',')[1]);
			var mimeString = dataURI.split(',')[0].split(':')[1].split(';')[0]
			var ab = new ArrayBuffer(byteString.length);
			var ia = new Uint8Array(ab);
			for (var i = 0; i < byteString.length; i++) {
				ia[i] = byteString.charCodeAt(i);
			}
			var bb = new Blob([ia], {type: meta});
			return window.URL.createObjectURL(bb);
		} catch (e) {
			return dataURI;
		}
	}
	this.Connect = function(ip) {
		this.ip = ip;
		var connect = this;
		this.getRawURL = function(props) {
			return this.ip.replace("{method}", JSON.parse(props)["mode"]).replace("{token}", that.token) + "?props=" + encodeURIComponent(props);
		}
		this.send = function(props, data, setHeader, callback, extra, upload) {
			// This function performs all input/output to/from the server.
			var xhr = new XMLHttpRequest();
			if (setHeader == true) {
				xhr.open("POST", this.getRawURL(props), true);
				xhr.setRequestHeader("Content-type", "application/x-www-form-urlencoded");
				xhr.send("props=" + encodeURIComponent(props));
			} else {
				xhr.open("PUT", this.getRawURL(props), true);
				xhr.setRequestHeader("Content-type", setHeader);
				xhr.overrideMimeType(setHeader);
				xhr.upload.addEventListener("progress", function(evt){
					if (evt.lengthComputable && upload) {
						upload(evt.loaded, evt.total);
					}
				}, false);
				xhr.send(data);
			}
			xhr.onreadystatechange = function() {
				if (this.readyState == 4) {
					if(200 == this.status) {
						try {
							var response = JSON.parse(xhr.responseText);
							if (response["error"] == true) {
								if(response["login"] == true) {
									if(that.isLoggingIn == false) {
										that.isLoggingIn = true;
										that.login(response["url"]);
									}
								} else {
									that.isLoggingIn = false;
									extra(response["errorMsg"], function(){});
								}
							} else {
								that.isLoggingIn = false;
								that.write = response["write"];
								callback(response["data"]);
							}
							return true;
						} catch(e) {
							new popup().bindAlert(e, function(){});
						}
					} else {
						new popup().bindAlert("Server responded with an invalid code. ", function(){});
					}
				}
			};
			xhr.onerror = function() {
				extra("Unable to connect to server. ");
			};
		}
		this.sendRaw = function(url, data, callback, extra) {
			var xhr = new XMLHttpRequest();

			xhr.open("GET", url, true);
			xhr.setRequestHeader("Content-type", "application/x-www-form-urlencoded");

			xhr.send(data);
			xhr.onreadystatechange = function() {
				if (this.readyState == 4) {
					if(200 == this.status) {
						callback(xhr.responseText);
					} else {
						new popup().bindAlert("Server responded with an invalid code. ", function(){});
					}
				}
			};
			xhr.onerror = function() {
				extra("Unable to connect to server. ");
			};
		}
	}
}

function send(method, path, data, callback, error) {
    var http = new XMLHttpRequest();
    http.open(method, path, true);
    http.setRequestHeader("Content-type", "application/x-www-form-urlencoded");
    http.send(data);
    http.onreadystatechange = function()
    {
        if(this.readyState == 4 && this.status == 200)
        {
            callback(http.responseText);
        }
    };
    http.onerror = function() {
		error();
	};
}

